import "./styles.css";
import { CopyToClipboard } from "react-copy-to-clipboard";

export default function Copyurl() {
 return (
   <div className="App">
     <h1>Clipboard Copy</h1>
     <CopyToClipboard
     text="text"
     onCopy={() => alert("Copied")}>
       <span>Copy to clipboard with span</span>
     </CopyToClipboard>
   </div>
 );
}
